import React from 'react';

const HtmlIframe = ({ url }) => {
  
    return (
        <div className="h-screen">
          <iframe
            src="https://www.helpndoc.com/"
            title="HelpNDoc"
            style={{ width: "100%", height: "100%", border: "none" }}
          />
        </div>
      );
 
};

export default HtmlIframe;
